ఈ కింద ప్రస్తావించిన అంశాలకు సంబంధించి, Manash లైఫ్‌స్టైల్ ప్రైవేట్ లిమిటెడ్ మరియు/లేదా దానికి సంబంధించిన ప్రతినిధి(లు) మరియు/లేదా Purplle (అన్నింటినీ కలిపి “Purplle” అని పిలుస్తారు) నియమించిన థర్డ్ పార్టీ(లు)కి నా అంగీకారాన్ని తెలియచేస్తున్నాను.
    ఎ)నా ఇమేజ్‌ను క్యాప్చర్ చేయడానికి మరియు/లేదా తమ వెబ్‌సైట్ / అప్లికేషన్ డేటాబేస్‌లో స్టోర్ చేయడానికి;
    (బి) ఏవైనా చర్మ సంబంధిత సమస్యలు ఉంటే వాటిని విశ్లేషించడం కోసం లేదా నాకు తెలపడం కోసం ఆ క్యాప్చర్ చేసిన/ స్టోర్ చేసిన ఇమేజ్‌ను ఉపయోగించడానికి, అలానే Purplle ఏదైనా సమాచారం(లు)/సిఫార్సు(లు)ను నాకు ఇచ్చినట్లయితే, అదంతా కూడా క్యాప్చర్ చేసిన / స్టోర్ చేసిన, Purplle తమ వెబ్‌సైట్‌ / అప్లికేషన్‌‌లో క్యాప్చర్ చేసిన ‌లేదా డేటాబేస్‌లో స్టోర్ చేసిన నా ఇమేజ్‌ను విశ్లేషించాకనే అందించాయని అంగీకరించి, ధృవీకరిస్తున్నాను.‌ అలానే గుర్తించిన ఏదైనా చర్మ సంబంధిత సమస్యపై చేసిన విశ్లేషణలో తప్పులకు లేదా చేసే తగిన సిఫార్సులకు(ప్రోడక్ట్‌లు తీసుకోమని చెప్పే సిఫార్సులతో సహా) Purplle బాధ్యత వహించదు.
